import 'bootstrap/dist/css/bootstrap.min.css';
import logoGeo from '../assets/img/logo/geo-logo.svg'
function HeaderFDI() {
  return (
    <div>



    <div class="row">
    <div class="col">
    <img src={logoGeo } class="img-fluid" alt="..."/>

    </div>
    <div class="col-6">
      2 of 3 (wider)
    </div>
    <div class="col">
      3 of 3
    </div>
  </div>
    </div>
  );
}
export default HeaderFDI;
